import React, { Component } from 'react';
import { BrowserRouter, Route } from 'react-router-dom';
// import NavBar from './components/NavBar/NavBar';
import HomePage from './pages/HomePage';
// import UserPage from './pages/UserPage';
import ListPage from './pages/ListPage';
// import ListNamesPage from './pages/ListNamesPage';
import './App.css';

class App extends Component {
  state = {
    lists: null
  }

  componentDidMount() {
    ListsAPI.fetchLists()
    .then(json => this.setState({ lists: json }))
  }

  listsState = (lists) => {
    this.setState({ lists: lists })
  }

  render() {
    return (
      <BrowserRouter>
        <div className='App'>
          {/* <NavBar /> */}
          <Route exact path='/' render={() => <HomePage listsState={this.listsState} lists={this.state.lists} />} />
          <Route exact path='/:listID' render={() => <ListPage lists={this.state.lists} />} />
          {/* <Route exact path='/babynames/:userID' component={UserPage} /> */}
          {/* <Route exact path='/babynames/:userID/lists' component={ListNamesPage} /> */}
          {/* <Route exact path='/babynames/:userID/lists/:listID' component={ListPage} /> */}
        </div>
      </BrowserRouter>
    );
  }
}

export default App;
